        group1, group2 = groups
        gName1 = gName2 = None
        for gName, group in f.groups.items():
            if 'kern1' in gName and group1[0] in group:
                gName1 = gName
            elif 'kern2' in gName and group2[0] in group:
                gName2 = gName
        if (gName1, gName2) in f.kerning:
            print('Delete kerning', gName1, gName2, f.path)
            del f.kerning[(gName1, gName2)]          

